def portfolio_price():    portfolio = [ ( "25-Jan-2020", 43.50, 25, 'CAT', 92.45 ),( "25-Jan-2020", 42.80, 50, 'DD', 51.19 ),( "25-Jan-2020", 42.10, 75, 'EK', 34.87 ),                 ( "25-Jan-2020", 37.58, 100, 'GM', 37.58 )]    total = 0    for block in portfolio:        cost = block[2]*block[1]        gain = block[2]*block[4]        total = total + (gain - cost)        return total